import React from "react";

import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

import * as styled from "../styledComp/styledMain";

function Main() {
  let StationIdData = useSelector((state) => state.StationNameData.stationId);

  return (
    <styled.Main>
      <h1>대전 지하철 NOW!</h1>
      {StationIdData.map((e, i) => (
        <StationList key={i} StationIdData={StationIdData[i]} i={i + 101} />
      ))}
    </styled.Main>
  );
}

function StationList(props) {
  return (
    <styled.StationList>
      <ul>
        <li>
          <Link to={`arrivalinfo/` + props.i}>
            {" "}
            <button>{props.StationIdData.name} </button>
          </Link>
        </li>
      </ul>
    </styled.StationList>
  );
}

export default Main;
